- input: "TEXT\x1CC00188367\x1CTEXT-00001\x1C\x1CF3XA\x1CThe original 2013 February
    Monthly report included the H1 reflecting the administrative allocation ratio
    of 21% which was correct. We have identified a programming error in our software
    that calculated Administrative expenses using a 36% Federal ratio. This report
    corrects the Administrative Expense totals (Federal and Non-Federal share). Total
    receipts and disbursements remain unchanged. Please note that no excessive allocation
    transfer from the Non-Federal to the Federal account has been made as the 36%/64%
    ratio was used rather than the 21%/79% ratio.  Schedule A Line 15 reflects a number
    of receipts for the payment of rent, telephone and copies. The Democratic Party
    of Oregon shares office space with several organizations. We write one check to
    pay rent. The amount of rent paid by each organization is assessed at the usual
    and normal charge, determined by the amount of space occupied by the organization.
    Schedule A Line 15 reflects receipts from various County party and candidate committees.
    The Democratic Party of Oregon offers our County Committees and candidates a number
    of technology services at cost.  These services include website and email services.
    Payments for salaries and wages reported on Schedule H4 are for employees who
    spent less than 25% of their time on FEA or activities in connection with a Federal
    election. Employees who spend more than 25% of their time on FEA or activities
    in connection with a Federal election are paid with 100% Federal funds as are
    their fringe benefits and reported on Line 30b.   This report includes Memo Schedule
    A entries for contributions raised by the ASDC Dollars for Democrats and OR  Victory
    Fund  (Democratic National Committee) programs. The committee may not have received
    its share of the proceeds as of the end of the reporting period. The committee
    expects to receive transfers at some point in the three months following this
    report.\n"
